Job Description:
This one's a little big. When they dropped the fiber in the apartment, they put the box in the closet. That would be fine, except there's no outlet in the closet to set up the modem and router. To get a round this, you have to run the fiber cable out through a crack above the closet door. This will cause the door (over time) to pinch, rub against, and sever the cable. Can we;
1. Drop an outlet inside the closet (best solution)?
2. Re drop the fiber outside of the closet?
